import React, { Component } from 'react';
import './App.css';
import GameManager from './GameManager';
import { Route, Switch, Redirect, NavLink } from 'react-router-dom';
function App() {
    return (
      <div className="App">
        <header className="App-header">
            <button href="gameManager">Hello</button>
            <div>
              <Switch>
                <Route path='/gameManager' render={GameManager} />
                <Redirect to='/' />
              </Switch>
            </div>
        </header>
      </div>
    );
}

export default App;
